		function generate() {

			let doc = new jsPDF('l', 'pt');
			var estad = sessionStorage.estado;
			var numtaxiPdf;
			var choferPdf;
			var choferTxtPdf;
			var fecha1Pdf;
			var fecha2Pdf;

			if (estad == 0) {
			    var f = new Date();
				var mes = f.getMonth() + 1; //09
				var diaNumero = f.getDate(); //09
				var mes1;

				if (mes <= 9) {
					mes1 = "0" + mes;
				} else {
					mes1 = mes;
				}

				var fechaactual=diaNumero + "/" + mes1 + "/" + f.getFullYear();

				numtaxiPdf = "General";
				choferPdf = "General";
				choferTxtPdf = "General";
				fecha1Pdf = fechaactual;
				fecha2Pdf = fechaactual;
			} else {
				numtaxiPdf = document.getElementById("my-table").rows[1].cells[1].innerHTML;
				choferPdf = document.getElementById("chofer").value;
				choferTxtPdf = $("#chofer option:selected").text();
				fecha1Pdf = document.getElementById("date-start").value;
				fecha2Pdf = document.getElementById("date-end").value;
			}


			var fecha1 = fecha1Pdf;
			var fecha2 = fecha2Pdf;
			var chofer = choferTxtPdf;
			var numerotaxi = numtaxiPdf;
			/* HEDER */

			var imgData = 'data:image/jpeg;base64,';


			//doc.addImage(imgData, 'image format', x, y, w, h, 'alias');

			doc.setDrawColor(196, 196, 196); // draw red lines
			doc.rect(42, 3, 73, 73);
			doc.addImage(imgData, 'JPEG', 44, 5, 70, 70, 'alias');
			doc.setFontSize(15);
			doc.setFontStyle('bold');
			doc.text('REPORTE VIAJES.', 120, 40);
			doc.setFontSize(10);
			doc.setTextColor(75, 72, 72);
			doc.setFontStyle('bold');
			doc.text('Numero de Taxi: ', 120, 70);
			doc.setFontStyle('normal');
			doc.text(numerotaxi, 200, 70);
			doc.setFontStyle('bold');
			doc.text('Chofer: ', 355, 70);
			doc.setFontStyle('normal');
			doc.text(chofer, 394, 70);
			doc.setFontStyle('bold');
			doc.text('Fecha: ', 640, 70);
			doc.setFontStyle('normal');
			doc.text(fecha1 + "  a  " + fecha2, 675, 70);



			const options2 = {
				headerStyles: {
					fillColor: [124, 124, 124],
					halign: 'center',
					lineWidth: 1,
					lineColor: [221, 221, 221]
				},
				bodyStyles: {
					fontSize: 8,
				},
				margin: {
					top: 26,
					left: 595
				},
				columnStyles: {
					0: {
						columnWidth: 90
					},
					1: {
						columnWidth: 120
					},
				}
			};

			var tablareportettl = doc.autoTableHtmlToJson(document.getElementById("my-tableTotal"));
			doc.autoTable(tablareportettl.columns, tablareportettl.data, options2);



			const totalPagesExp = '{total_pages_count_string}';
			const footer = function (data) {
				let str = 'Pagina ' + data.pageCount;


				// Nmero total de pginas plug-in slo est disponible en jspdf v1.0 +
				if (typeof doc.putTotalPages === 'function') {
					str = str + ' de ' + totalPagesExp;
				}
				doc.text(str, data.settings.margin.left, doc.internal.pageSize.height - 30);
			};

			const options = {
				//beforePageContent: header,
				afterPageContent: footer,
				headerStyles: {
					fillColor: [124, 124, 124],
					halign: 'center',
					lineWidth: 1,
					lineColor: [221, 221, 221],
				},
				bodyStyles: {
					fontSize: 8,
					cellWidth: 'auto'
				},
				margin: {
					top: 80
				}
			};


			//var elem = document.getElementById('table');
			var data = doc.autoTableHtmlToJson(document.getElementById('my-table'));
			doc.autoTable(data.columns, data.rows, options);




			// Complemento de nmero de pgina total solo disponible en jspdf v1.0 +
			if (typeof doc.putTotalPages === 'function') {
				doc.putTotalPages(totalPagesExp);
			}



			doc.save('ReporteTak-Si.pdf');

		}
